/**
 * @param Integer[] $temperatures
 * @return Integer[]
 */
function dailyTemperatures($temperatures)
{
    $res = [];
    $max = PHP_INT_MAX;
    for ($i = 0; $i < count($temperatures); $i++) {

        if ($temperatures[$i] >= $max) {
            $res[$i] = 0;
            continue;
        }
        for ($j = $i; $j < count($temperatures); $j++) {

            if ($temperatures[$i] < $temperatures[$j]) {
                $res[$i] = $j - $i;
                break;
            }
        }
        if (!isset($res[$i])) {
            $res[$i] = 0;
            $max = $temperatures[$i];
        }
    }
    return $res;
}

